import React from "react";
import ButtonChallenge1 from "./buttonchallenge1.js";
import Tik from "./Tik";
import Game1 from "./Game1";
import Game from "./Game";
import TicTacToeGameTask1 from "./tictactoegame-task1.js";
import Game3 from "./Game3";
import Tictac from "./tictac";
const logo = "https://webmastershisar.com/wp-content/uploads/2017/03/wmh9.png";

class MenuNav1 extends React.Component {
  constructor() {
    super();
    this.state = { cshow: "None Component Showing" };
  }

  myClickHandler = (event) => {
    let nam = event.target.name;
    let cshow = null;
    //alert("Button Component Is: " + nam);
    switch (nam) {
      case "Tik":
        cshow = <Tik />;
        break;
      case "Tictac":
        cshow = <Tictac />;
        break;
      case "TicTacToeGameTask1":
        cshow = <TicTacToeGameTask1 />;
        break;
      case "ButtonChallenge1":
        cshow = <ButtonChallenge1 />;
        break;
      case "Game1":
        cshow = <Game1 />;
        break;
      case "Game":
        cshow = <Game />;
        break;
      case "Game3":
        cshow = <Game3 />;
        break;
    }
    this.setState({ cshow: cshow });
  };

  render() {
    return (
      <div>
        <div>
          <a href="https://webmastershisar.com/">
            <img src={logo} alt="Logo" />
          </a>
        </div>
        {/*<h1>Hi, I am MenuNav1 component.</h1>
        <h4>Click any button to see its component.</h4>*/}
        <div style={{ backgroundColor: "#e0e0e0" }}>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Home"
            style={{
              backgroundColor: "red",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            <a href="https://webmastershisar.com/">Home</a>
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Game"
            style={{
              backgroundColor: "lightblue",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            Game.js <br /> (Date: 7 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Game1"
            style={{
              backgroundColor: "lightyellow",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            Game1.js <br /> (Date: 7 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Tik"
            style={{
              backgroundColor: "lightpink",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            Tik.js <br /> (Date: 7 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Tictac"
            style={{
              backgroundColor: "lightpink",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            tictac.js <br /> (Date: 8 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="TicTacToeGameTask1"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            tictactoegame-task1.js <br /> (Date: 7 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="ButtonChallenge1"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            ButtonChallenge1.js <br /> (Date: 4 July 2020)
          </button>
        </div>
        <div style={{ backgroundColor: "black" }}>
          <h3>Component Showing:</h3>
          <hr />
          {this.state.cshow}
        </div>
      </div>
    );
  }
}

export default MenuNav1;
